const InfoList = (props) => {
    const infos = props.infos;
    const title = props.title;
    const details = props.details;
    return ( 
        <div>
            <h2>{title}</h2>
             {
                    infos.map( (info) => (
                    <div className="info" key={info.id}>
                        <h2>Mr/Mrs : {info.title}</h2>
                        <p>Work : {info.work}</p> 
                    </div>
             ))},
              {
                    details.map( (detail) => (
                    <div className="info" key={detail.id}>
                        <h2>Mr/Mrs : {detail.title}</h2>
                        <p>Work : {detail.work}</p> 
                    </div>
             ))}
        </div>
     );
}
 
export default InfoList;
